INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1.47, 1, 1, 0.0, 2002, "2023/09/22 14:59:59", 2, 10001, 1, "クローチェ", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 126401, "2023/06/30 12:00:00", -470.0);
