INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (0.0, 1, 1, 0.0, 2002, "2023/09/22 14:59:59", 2, 10003, 2, "ライラエル", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 126501, "2023/06/30 12:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (0.0, 1, 2, 0.0, 2002, "2023/09/22 14:59:59", 1, 10004, 1, "ライラエル", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 126501, "2023/06/30 12:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (0.0, 2, 1, 0.0, 2002, "2023/12/22 14:59:59", 2, 10005, 2, "リンド", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 127702, "2023/09/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (0.0, 2, 2, 0.0, 2002, "2023/12/22 14:59:59", 2, 10006, 2, "リンド", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 127702, "2023/09/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (0.0, 2, 1, 0.0, 2002, "2023/12/22 14:59:59", 1, 10007, 1, "ヴルム", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 127802, "2023/09/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (6.5, 2, 2, 0.0, 2002, "2023/12/22 14:59:59", 1, 10008, 2, "ヴルム", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 127802, "2023/09/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (0.0, 3, 1, 0.0, 2002, "2024/03/22 14:59:59", 1, 10009, 2, "アネモネ", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 129602, "2023/12/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (0.0, 3, 2, 0.0, 2002, "2024/03/22 14:59:59", 1, 10010, 2, "アネモネ", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 129602, "2023/12/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (0.0, 3, 1, 0.0, 2002, "2024/03/22 14:59:59", 1, 10011, 1, "ネフィ=ネラ", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 129701, "2023/12/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (6.2, 3, 2, 0.0, 2002, "2024/03/22 14:59:59", 1, 10012, 2, "ネフィ=ネラ", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 129701, "2023/12/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (3.1, 4, 1, 0.0, 2002, "2024/06/22 14:59:59", 5, 10013, 3, "カノン", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 130301, "2024/03/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (6.15, 4, 2, 0.0, 2002, "2024/06/22 14:59:59", 2, 10014, 3, "カノン", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 130301, "2024/03/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (0.0, 4, 1, 0.0, 2002, "2024/06/22 14:59:59", 2, 10015, 2, "ナーナ", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 130401, "2024/03/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (3.35, 4, 2, 0.0, 2002, "2024/06/22 14:59:59", 1, 10016, 2, "ナーナ", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 130401, "2024/03/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (0.0, 5, 1, 0.0, 2002, "2024/09/22 14:59:59", 1, 10017, 1, "ホウオウ", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 130502, "2024/06/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (3.18, 5, 2, 0.0, 2002, "2024/09/22 14:59:59", 1, 10018, 2, "ホウオウ", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 130502, "2024/06/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (0.0, 5, 3, 0.0, 2002, "2024/09/22 14:59:59", 4, 10019, 4, "ホウオウ", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 130503, "2024/06/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (4.9, 5, 1, 0.0, 2002, "2024/09/22 14:59:59", 2, 10020, 1, "ネア", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 123301, "2024/06/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (4.8, 5, 2, 0.0, 2002, "2024/09/22 14:59:59", 2, 10021, 1, "ネア", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 123301, "2024/06/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (4.922, 6, 1, 0.0, 2002, "2024/12/22 14:59:59", 1, 10022, 3, "カリザ", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 133301, "2024/09/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (9.638, 6, 2, 0.0, 2002, "2024/12/22 14:59:59", 5, 10023, 3, "カリザ", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 133301, "2024/09/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2.88, 6, 1, 0.0, 2002, "2024/12/22 14:59:59", 2, 10024, 1, "ミーア", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 133401, "2024/09/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (4.818, 6, 2, 0.0, 2002, "2024/12/22 14:59:59", 1, 10025, 5, "ミーア", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 133401, "2024/09/15 15:00:00", -470.0);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (1.78, 7, 1, 0.0, 2002, "2025/03/22 14:59:59", 1, 10026, 2, "グレイス", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 133002, "2024/12/15 15:00:00", -470.0);
